import './header.styles.css';

const Header = () => {
    return (
        <div className='header'>
        <h2>HeliBUY</h2>
        <div className='nav'>
            <a href=''>Home</a>
            <a>Shop</a>
            <a>Blog</a>
            <a>Contact</a>
        </div>
        <h4 className='h4_bold'>www.helibuy.org</h4>
    </div>
    )
}

export default Header
